import React from 'react'

const NavSearch = () => {
    return(
    <div>
        <form>
            <input type="text" placeholder="Search" style={navSearch_style}/>
        </form>
    </div>
    );
}

const navSearch_style = {
    height: "4.5vh",
    width: "100%",
    marginTop: "1.5vh",
    borderRadius: "10px",
    fontSize: "2vh"
}

export default NavSearch
